import React, { Component } from 'react';
import Interviews from './Interviews';
import NewInterview from './NewInterview';
import NewJobs from './NewJobs';
import TestSkills from './TestSkills';
import AboutUs from './AboutUs';
import { Route, NavLink, Switch } from 'react-router-dom';

function myFunction() {
  var x = document.getElementById("myLinks");
  if (x.style.display === "block") {
    x.style.display = "none";
  } else {
    x.style.display = "block";
  }
}

const header = (props) => {
    return (
        <div>

            <div className="topnav">
              <a href="#home" className="active">Logo</a>
              <div id="myLinks">
                <NavLink to = "/interviews/">Interviews</NavLink>
                <NavLink to = "/test-skills/">Test Your Skills</NavLink>
                <NavLink to = "/login/" exact >Login</NavLink>
                <NavLink to = "/new-jobs/" exact >New Job Openings</NavLink>
              </div>
              <a href="javascript:void(0);" className="icon" onclick="myFunction()">
                <i className="fa fa-bars"></i>
              </a>
            </div>

            <nav className="navbar navbar-inverse">
              <div className="container-fluid">
                <div className="navbar-header">
                  <NavLink to = "/" className="navbar-brand">InterviewCorner</NavLink>
                </div>
                <ul className="nav navbar-nav">
                  <NavLink to = "/interviews/">Interviews</NavLink>
                  <NavLink to = "/test-skills/">Test Your Skills</NavLink>
                  <NavLink to = "/login/" exact >Login</NavLink>
                  <NavLink to = "/new-jobs/" exact >New Job Openings</NavLink>
                </ul>
              </div>
            </nav>
            <Switch>
                    <Route path = "/test-skills" exact component = { TestSkills } />
                    <Route path = "/interviews/" exact  component = { Interviews } />
                    <Route path = "/"  exact component = { AboutUs } />
                    <Route path = "/interviews/new" exact component = { NewInterview } />
                    <Route path = "/new-jobs" exact component = { NewJobs } />
                    {/*<Route path = "/:id" exact  component = { FullPost } />*/}
            </Switch>
        </div>
    );
}

export default header;
